INSERT INTO `commands_text` VALUES ('additem', '2', '.additem #itemid/[#itemname]/#shift-click-item-link #itemcount', '', 'Adds the specified number of items of id #itemid (or exact (!) name $itemname in brackets, or link created by shift-click at item in inventory or recipe) to your or selected character inventory. If #itemcount is omitted, only one item will be added.\r\n.');
INSERT INTO `commands_text` VALUES ('npc subname', '2', '', '', 'Syntax: .npc subname $Name\r\n\r\nChange the subname of the selected creature or player to $Name.\r\n\r\nCommand disabled.');
