INSERT INTO `commands_text` VALUES ('go creature', '3', '.go creature (#creature_guid|$creature_name|id #creature_id)', '', 'Телепортация вашего персонажа к существо с GUID, или телепорт вашего персонажа к существу с именем, или телепорт вашего персонажа к существу с записью id.');
