INSERT INTO `commands_text` VALUES ('npc say', '3', '.npc say #text', '', 'Заставить существо говорить набраный текст.');
INSERT INTO `commands_text` VALUES ('npc yell', '3', '.npc yell #text', '', 'Заставить существо кричать набраный текст.');
INSERT INTO `commands_text` VALUES ('go object', '3', '.go object (#gameobject_guid|$gameobject_name|id #gameobject_id)', '', 'Телепорт выбранного игрока к объекту.');
INSERT INTO `commands_text` VALUES ('go trigger', '3', '.go trigger (#trigger_id|$trigger_shift-link|$trigger_target_shift-link) [target]', '', 'Телепорт вашего персонажа к areatrigger с ID #trigger_id.');
INSERT INTO `commands_text` VALUES ('gm setview', '3', '.gm setview', '', 'Установить дальновидность взгляд на выбранную единицу. Выберите себе множество просмотра назад.');
INSERT INTO `commands_text` VALUES ('additem', '3', '.additem #itemid/[#itemname]/#shift-click-item-link #itemcount', '', 'Adds the specified number of items of id #itemid (or exact (!) name $itemname in brackets, or link created by shift-click at item in inventory or recipe) to your or selected character inventory. If #itemcount is omitted, only one item will be added.\r\n.');
INSERT INTO `commands_text` VALUES ('npc subname', '3', '', '', 'Syntax: .npc subname $Name\r\n\r\nChange the subname of the selected creature or player to $Name.\r\n\r\nCommand disabled.');
INSERT INTO `commands_text` VALUES ('aura', '3', '', '', 'Syntax: .aura #spellid\r\n\r\nAdd the aura from spell #spellid to the selected Unit.');
INSERT INTO `commands_text` VALUES ('bank', '3', '', '', 'Syntax: .bank\r\n\r\nShow your bank inventory.');
INSERT INTO `commands_text` VALUES ('npc flag', '3', '', '', 'Syntax: .npc flag #npcflag\r\n\r\nSet the NPC flags of creature template of the selected creature and selected creature to #npcflag. NPC flags will applied to all creatures of selected creature template after server restart or grid unload/load.');
INSERT INTO `commands_text` VALUES ('delticket', '3', '', '', 'Syntax: .delticket all\r\n        .delticket #num\r\n        .delticket $character_name\r\n\rall to dalete all tickets at server, $character_name to delete ticket of this character, #num to delete ticket #num.');
INSERT INTO `commands_text` VALUES ('npc factionid', '3', '', '', 'Syntax: .npc factionid #factionid\r\n\r\nSet the faction of the selected creature to #factionid.');
INSERT INTO `commands_text` VALUES ('demorph', '3', '', '', 'Syntax: .demorph\r\n\r\nDemorph the selected player.');
INSERT INTO `commands_text` VALUES ('npc changelevel', '3', '', '', 'Syntax: .npc changelevel #level\r\n\r\nChange the level of the selected creature to #level.\r\n\r\n#level may range from 1 to 63.');
INSERT INTO `commands_text` VALUES ('npc delete', '3', '', '', 'Syntax: .npc delete [#guid]\r\n\r\nDelete creature with guid #guid (or the selected if no guid is provided)');
INSERT INTO `commands_text` VALUES ('honor addkill', '3', '', '', 'Syntax: .honor addkikll\r\n\r\nAdd the targeted unit as one of your pvp kills today (you only get honor if it\'s a racial leader or a player)');
INSERT INTO `commands_text` VALUES ('npc add', '3', '', '', 'Syntax: .npc add #creatureid\r\n\r\nSpawn a creature by the given template id of #creatureid.');
INSERT INTO `commands_text` VALUES ('npc additem', '3', '', '', 'Syntax: .npc additem #itemId <#maxcount><#incrtime><#extendedcost>r\r\n\r\nAdd item #itemid to item list of selected vendor. Also optionally set max count item in vendor item list and time to item count restoring and items ExtendedCost.');
INSERT INTO `commands_text` VALUES ('guild create', '3', '', '', 'Syntax: .guild create [$GuildLeaderName] \"$GuildName\"\r\n\r\nCreate a guild named $GuildName with the player $GuildLeaderName (or selected) as leader.  Guild name must in quotes.');
INSERT INTO `commands_text` VALUES ('guild rank', '3', '', '', 'Syntax: .guild rank [$CharacterName] #Rank\r\n\r\nSet for player $CharacterName (or selected) rank #Rank in a guild.');
INSERT INTO `commands_text` VALUES ('guid', '3', '', '', 'Syntax: .guid\r\n\r\nDisplay the GUID for the selected character.');
INSERT INTO `commands_text` VALUES ('itemmove', '3', '', '', 'Syntax: .itemmove #sourceslotid #destinationslotid\r\n\r\nMove an item from slots #sourceslotid to #destinationslotid in your inventory\r\n\r\nNot yet implemented');
INSERT INTO `commands_text` VALUES ('kick', '3', '', '', 'Syntax: .kick [$charactername]\r\n\r\nKick the given character name from the world. If no character name is provided then the selected player (except for yourself) will be kicked.');
INSERT INTO `commands_text` VALUES ('npc setmodel', '3', '', '', 'Syntax: .npc setmodel #displayid\r\n\r\nChange the model id of the selected creature to #displayid.');
INSERT INTO `commands_text` VALUES ('gobject move', '3', '', '', 'Syntax: .gobject move #goguid [#x #y #z]\r\n\r\nMove gameobject #goguid to character coordinates (or to (#x,#y,#z) coordinates if its provide).');
INSERT INTO `commands_text` VALUES ('gobject add', '3', '', '', 'Syntax: .gobject add #id <spawntimeSecs>\r\n\r\nAdd a game object from game object templates to the world at your current location using the #id.\r\nspawntimesecs sets the spawntime, it is optional.\r\n\r\nNote: this is a copy of .gameobject.');
INSERT INTO `commands_text` VALUES ('gobject delete', '3', '', '', 'Syntax: .gobject delete #go_guid\r\nDelete gameobject with guid #go_guid.');
INSERT INTO `commands_text` VALUES ('lookup item', '3', '', '', 'Syntax: .lookup item $itemname\r\n\r\nLooks up an item by $itemname, and returns all matches with their Item ID\'s.');
INSERT INTO `commands_text` VALUES ('trigger active', '3', '', '', 'Syntax: .trigger active\r\n\r\nShow list of areatriggers with activation zone including current character position.');
INSERT INTO `commands_text` VALUES ('guild uninvite', '3', '', '', 'Syntax: .guild uninvite [$CharacterName]\r\n\r\nRemove player $CharacterName (or selected) from a guild.');
INSERT INTO `commands_text` VALUES ('npc spawndist', '3', '', '', 'Syntax: .npc spawndist #dist\r\n\r\nAdjust spawndistance of selected creature to dist.');
INSERT INTO `commands_text` VALUES ('npc spawntime', '3', '', '', 'Syntax: .npc spawntime #time \r\n\r\nAdjust spawntime of selected creature to time.');
INSERT INTO `commands_text` VALUES ('npc setmovetype', '3', '', '', 'Syntax: .npc setmovetype [#creature_guid] stay/random/way [NODEL]\r\n\r\nSet for creature pointed by #creature_guid (or selected if #creature_guid not provided) movement type and move it to respawn position (if creature alive). Any existing waypoints for creature will be removed from the database if you do not use NODEL. If the creature is dead then movement type will applied at creature respawn.\r\nMake sure you use NODEL, if you want to keep the waypoints.');
INSERT INTO `commands_text` VALUES ('npc name', '3', '', '', 'Syntax: .npc name $name\r\n\r\nChange the name of the selected creature or character to $name.\r\n\r\nCommand disabled.');
INSERT INTO `commands_text` VALUES ('npc move', '3', '', '', 'Syntax: .npc move [#creature_guid]\r\n\r\nMove the targeted creature spawn point to your coordinates.');
INSERT INTO `commands_text` VALUES ('pinfo', '3', '', '', 'Syntax: .pinfo [$player_name]\r\n\r\nOutput account information for selected player or player find by $player_name.');
INSERT INTO `commands_text` VALUES ('modify standstate', '3', '', '', 'Syntax: .modify standstate #emoteid\r\n\r\nChange the emote of your character while standing to #emoteid.');
INSERT INTO `commands_text` VALUES ('npc addmove', '3', '', '', 'Syntax: .npc addmove #creature_guid [#waittime]\r\n\r\nAdd your current location as a waypoint for creature with guid #creature_guid. And optional add wait time.');
INSERT INTO `commands_text` VALUES ('npc setphase', '3', '', '', 'Syntax: .npc setphase #phasemask\r\n\r\nSelected unit or pet phasemask changed to #phasemask with related world vision update for players. In creature case state saved to DB and persistent. In pet case change active until in game phase changed for owner, owner re-login, or GM-mode enable/disable..');
INSERT INTO `commands_text` VALUES ('ticket', '3', '', '', 'Syntax: .ticket on\r\n        .ticket off\r\n        .ticket #num\r\n        .ticket $character_name\r\n        .ticket respond #num $response\r\n        .ticket respond $character_name $response\r\n\r\non/off for GMs to show or not a new ticket directly, $character_name to show ticket of this character, #num to show ticket #num.');
INSERT INTO `commands_text` VALUES ('debug anim', '3', '', '', 'Syntax: .debug anim #emoteid\r\n\r\nPlay emote #emoteid for your character.');
INSERT INTO `commands_text` VALUES ('honor add', '3', '', '', 'Syntax: .honor add $amount\r\n\r\nAdd a certain amount of honor (gained today) to the selected player.');
INSERT INTO `commands_text` VALUES ('gobject setphase', '3', '', '', 'Syntax: .gobject setphase #guid #phasemask\r\n\r\nGameobject with DB guid #guid phasemask changed to #phasemask with related world vision update for players. Gameobject state saved to DB and persistent.');
INSERT INTO `commands_text` VALUES ('wp add', '3', '', '', 'Syntax: .wp add [#creature_guid or Select a Creature]');
INSERT INTO `commands_text` VALUES ('wp modify', '3', '', '', 'Syntax: .wp modify [#creature_guid or Select a Creature]\r\nadd - Add a waypoint after the selected visual\r\nwaittime $time\r\nemote ID\r\nspell ID\r\ntext1| text3| text3| text4| text5 <text>\r\nmodel1 ID\r\nmodel2 ID\r\nmove(moves wp to player pos)\r\ndel (deletes the wp)\r\n\r\nOnly one parameter per time!');
INSERT INTO `commands_text` VALUES ('wp show', '3', '', '', 'Syntax: .wp show [#creature_guid or Select a Creature]\r\non\r\nfirst\r\nlast\r\noff\r\ninfo\r\n\r\nFor using info you have to do first show on and than select a Visual-Waypoint and do the show info!');
INSERT INTO `commands_text` VALUES ('gobject turn', '3', '', '', 'Syntax: .gobject turn #goguid \r\n\r\nSet for gameobject #goguid orientation same as current character orientation.');
INSERT INTO `commands_text` VALUES ('honor update', '3', '', '', 'Syntax: .honor update\r\n\r\nForce the yesterday\'s honor fields to be updated with today\'s data, which will get reset for the selected player.');
INSERT INTO `commands_text` VALUES ('guild invite', '3', '', '', 'Syntax: .guild invite [$CharacterName] \"$GuildName\"\r\n\r\nAdd player $CharacterName (or selected) into a guild $GuildName. Guild name must in quotes.');
INSERT INTO `commands_text` VALUES ('modify rep', '3', '', '', 'Syntax: .modify rep #repId (#repvalue | $rankname [#delta])\r\nSets the selected players reputation with faction #repId to #repvalue or to $reprank.\r\nIf the reputation rank name is provided, the resulting reputation will be the lowest reputation for that rank plus the delta amount, if specified.\r\nYou can use \'.pinfo rep\' to list all known reputation ids, or use \'.lookup faction $name\' to locate a specific faction id.');
INSERT INTO `commands_text` VALUES ('npc delitem', '3', '', '', 'Syntax: .npc delitem #itemId\r\n\r\nRemove item #itemid from item list of selected vendor.');
INSERT INTO `commands_text` VALUES ('modify morph', '3', '', '', 'Syntax: .modify morph #displayid\r\n\r\nChange your current model id to #displayid.');
INSERT INTO `commands_text` VALUES ('gobject target', '3', '', '', 'Syntax: .gobject target [#go_id|#go_name_part]\r\n\r\nLocate and show position nearest gameobject. If #go_id or #go_name_part provide then locate and show position of nearest gameobject with gameobject template id #go_id or name included #go_name_part as part.');
INSERT INTO `commands_text` VALUES ('lookup event', '3', '', '', 'Syntax: .lookup event $name\r\nAttempts to find the ID of the event with the provided $name.');
INSERT INTO `commands_text` VALUES ('event', '3', '', '', 'Syntax: .event #event_id\r\nShow details about event with #event_id.');
INSERT INTO `commands_text` VALUES ('event list', '3', '', '', 'Syntax: .event list\r\nShow list of currently active events.\r\nShow list of all events');
INSERT INTO `commands_text` VALUES ('event start', '3', '', '', 'Syntax: .event start #event_id\r\nStart event #event_id. Set start time for event to current moment (change not saved in DB).');
INSERT INTO `commands_text` VALUES ('event stop', '3', '', '', 'Syntax: .event stop #event_id\r\nStop event #event_id. Set start time for event to time in past that make current moment is event stop time (change not saved in DB).');
INSERT INTO `commands_text` VALUES ('combatstop', '3', '', '', 'Syntax: .combatstop [$playername]\r\nStop combat for selected character. If selected non-player then command applied to self. If $playername provided then attempt applied to online player $playername.');
INSERT INTO `commands_text` VALUES ('learn all_recipes', '3', '', '', 'Syntax: .learn all_recipes [$profession]\r\rLearns all recipes of specified profession and sets skill level to max.\rExample: .learn all_recipes enchanting');
INSERT INTO `commands_text` VALUES ('lookup account ip', '3', '', '', 'Syntax: lookup account ip $ippart [#limit] \r\n\r\n Searchs accounts, which last used ip inluding $ippart (textual) with optional parametr #$limit of results. If #limit not provided expected 100.');
INSERT INTO `commands_text` VALUES ('lookup account email', '3', '', '', 'Syntax: .lookup account email $emailpart [#limit] \r\n\r\n Searchs accounts, which email including $emailpart with optional parametr #limit of results. If #limit not provided expected 100.');
INSERT INTO `commands_text` VALUES ('server corpses', '3', '', '', 'Syntax: .server corpses\r\n\r\nTriggering corpses expire check in world.');
INSERT INTO `commands_text` VALUES ('character titles', '3', '', '', 'Syntax: .character titles [$player_name]\r\n\r\nShow known titles list for selected player or player find by $player_name.');
INSERT INTO `commands_text` VALUES ('repairitems', '3', '', '', 'Syntax: .repairitems\r\n\r\nRepair all selected player\'s items.');
INSERT INTO `commands_text` VALUES ('npc follow', '3', '', '', 'Syntax: .npc follow\r\n\r\nSelected creature start follow you until death/fight/etc.');
INSERT INTO `commands_text` VALUES ('npc unfollow', '3', '', '', 'Syntax: .npc unfollow\r\n\r\nSelected creature (non pet) stop follow you.');
INSERT INTO `commands_text` VALUES ('waterwalk', '3', '', '', 'Syntax: .waterwalk on/off\r\n\r\nSet on/off waterwalk state for selected player.');
INSERT INTO `commands_text` VALUES ('npc tame', '3', '', '', 'Syntax: .npc tame\r\n\r\nTame selected creature (tameable non pet creature). You don\'t must have pet.');
INSERT INTO `commands_text` VALUES ('modify gender', '3', '', '', 'Syntax: .modify gender male/female\r\n\r\nChange gender of selected player.');
INSERT INTO `commands_text` VALUES ('character reputation', '3', '', '', 'Syntax: .character reputation [$player_name]\r\n\r\nShow reputation information for selected player or player find by $player_name.');
INSERT INTO `commands_text` VALUES ('gobject near', '3', '', '', 'Syntax: .gobject near  [#distance]\r\n\r\nOutput gameobjects at distance #distance from player. Output gameobject guids and coordinates sorted by distance from character. If #distance not provided use 10 as default value.');
INSERT INTO `commands_text` VALUES ('npc setdeathstate', '3', '', '', 'Syntax: .npc setdeathstate on/off\r\n\r\nSet default death state (dead/alive) for npc at spawn.');
INSERT INTO `commands_text` VALUES ('character customize', '3', '', '', 'Syntax: .character customize [$name]\r\n\r\nMark selected in game or by $name in command character for customize at next login.');
INSERT INTO `commands_text` VALUES ('character rename', '3', '', '', 'Syntax: .character rename [$name]\r\n\r\nMark selected in game or by $name in command character for rename at next login.');
INSERT INTO `commands_text` VALUES ('guild delete', '3', '', '', 'Syntax: .guild delete \"$GuildName\"\r\n\r\nDelete guild $GuildName. Guild name must in quotes.');
INSERT INTO `commands_text` VALUES ('titles add', '3', '', '', 'Syntax: .titles add #title\r\nAdd title #title (id or shift-link) to known titles list for selected player.');
INSERT INTO `commands_text` VALUES ('titles current', '3', '', '', 'Syntax: .titles current #title\r\nSet title #title (id or shift-link) as current selected titl for selected player. If title not in known title list for player then it will be added to list.');
INSERT INTO `commands_text` VALUES ('titles remove', '3', '', '', 'Syntax: .titles remove #title\r\nRemove title #title (id or shift-link) from known titles list for selected player.');
INSERT INTO `commands_text` VALUES ('titles setmask', '3', '', '', 'Syntax: .titles setmask #mask\r\n\r\nAllows user to use all titles from #mask.\r\n\r\n #mask=0 disables the title-choose-field');
INSERT INTO `commands_text` VALUES ('lookup title', '3', '', '', 'Syntax: .lookup title $$namepart\r\n\r\nLooks up a title by $namepart, and returns all matches with their title ID\'s and index\'s.');
INSERT INTO `commands_text` VALUES ('lookup account name', '3', '', '', 'Syntax: .lookup account name $accountpart [#limit] \r\n\r\n Searchs accounts, which username including $accountpart with optional parametr #limit of results. If #limit not provided expected 100.');
INSERT INTO `commands_text` VALUES ('lookup player account', '3', '', '', 'Syntax: .lookup player account $accountpart [#limit] \r\n\r\n Searchs players, which account username including $accountpart with optional parametr #limit of results. If #limit not provided expected 100.');
INSERT INTO `commands_text` VALUES ('lookup player email', '3', '', '', 'Syntax: .lookup player email $emailpart [#limit] \r\n\r\n Searchs players, which account email including $emailpart with optional parametr #limit of results. If #limit not provided expected 100.');
INSERT INTO `commands_text` VALUES ('lookup player ip', '3', '', '', 'Syntax: .lookup player ip $ippart [#limit] \r\n\r\n Searchs players, which account last used ip inluding $ippart (textual) with optional parametr #limit of results. If #limit not provided expected 100.');
INSERT INTO `commands_text` VALUES ('trigger', '3', '', '', 'Syntax: .trigger [#trigger_id|$trigger_shift-link|$trigger_target_shift-link]\r\n\r\nShow detail infor about areatrigger with id #trigger_id or trigger id associated with shift-link. If areatrigger id or shift-link not provided then selected nearest areatrigger at current map.');
INSERT INTO `commands_text` VALUES ('trigger near', '3', '', '', 'Syntax: .trigger near [#distance]\r\n\r\nOutput areatriggers at distance #distance from player. If #distance not provided use 10 as default value.');
INSERT INTO `commands_text` VALUES ('character achievements', '3', '', '', 'Syntax: .character achievements [$player_name]\r\n\r\nShow completed achievments for selected player or player find by $player_name.');
INSERT INTO `commands_text` VALUES ('lookup achievement', '3', '', '', 'Syntax: .lookup $name\r\nLooks up a achievement by $namepart, and returns all matches with their quest ID\'s. Achievement shift-links generated with information about achievment state for selected player. Also for completed achievments in list show complete date.');
INSERT INTO `commands_text` VALUES ('lookup pool', '3', '', '', 'Syntax: .lookup pool $pooldescpart\r\n\r\nList of pools (anywhere) with substring in description.');
INSERT INTO `commands_text` VALUES ('pool list', '3', '', '', 'Syntax: .pool list\r\n\r\nList of pools with spawn in current map (only work in instances. Non-instanceable maps share pool system state os useless attempt get all pols at all continents.');
INSERT INTO `commands_text` VALUES ('pool spawns', '3', '', '', 'Syntax: .pool spawns #pool_id\r\n\r\nList current creatures/objects listed in pools (or in specific #pool_id) and spawned (added to grid data, not meaning show in world.');
INSERT INTO `commands_text` VALUES ('pool', '3', '.pool #pool_id', '', 'Pool information and full list creatures/gameobjects included in pool.');
INSERT INTO `commands_text` VALUES ('additemset', '3', '', '', 'Syntax: .additemset #itemsetid\r\n\r\nAdd items from itemset of id #itemsetid to your or selected character inventory. Will add by one example each item from itemset.');
INSERT INTO `commands_text` VALUES ('quest add', '3', '', '', 'Syntax: .quest add #quest_id\r\n\r\nAdd to character quest log quest #quest_id. Quest started from item can\'t be added by this command but correct .additem call provided in command output.');
INSERT INTO `commands_text` VALUES ('reset honor', '3', '', '', 'Syntax: .reset honor [Playername]\r\n  Reset all honor data for targeted character.');
INSERT INTO `commands_text` VALUES ('cooldown', '3', '', '', 'Syntax: .cooldown [#spell_id]\r\n\r\nRemove all (if spell_id not provided) or #spel_id spell cooldown from selected character or you (if no selection).');
INSERT INTO `commands_text` VALUES ('die', '3', '', '', 'Syntax: .die\r\n\r\nKill the selected player. If no player is selected, it will kill you.');
INSERT INTO `commands_text` VALUES ('distance', '3', '', '', 'Syntax: .distance [$name/$link]\r\n\r\nDisplay the distance from your character to the selected creature/player, or player with name $name, or player/creature/gameobject pointed to shift-link with guid.');
INSERT INTO `commands_text` VALUES ('explorecheat', '3', '', '', 'Syntax: .explorecheat #flag\r\n\r\nReveal  or hide all maps for the selected player. If no player is selected, hide or reveal maps to you.\r\n\r\nUse a #flag of value 1 to reveal, use a #flag value of 0 to hide all maps.');
INSERT INTO `commands_text` VALUES ('npc addweapon', '3', '', '', 'Not yet implemented.');
INSERT INTO `commands_text` VALUES ('hidearea', '3', '', '', 'Syntax: .hidearea #areaid\r\n\r\nHide the area of #areaid to the selected character. If no character is selected, hide this area to you.');
INSERT INTO `commands_text` VALUES ('hover', '3', '', '', 'Syntax: .hover #flag\r\n\r\nEnable or disable hover mode for your character.\r\n\r\nUse a #flag of value 1 to enable, use a #flag value of 0 to disable hover.');
INSERT INTO `commands_text` VALUES ('server idleshutdown cancel', '3', '', '', 'Syntax: .server idleshutdown cancel\r\n\r\nCancel the restart/shutdown timer if any.');
INSERT INTO `commands_text` VALUES ('server idleshutdown', '3', '', '', 'Syntax: .server idleshutdown #delay [#exist_code]\r\n\r\nShut the server down after #delay seconds if no active connections are present (no players). Use #exist_code or 0 as program exist code.');
INSERT INTO `commands_text` VALUES ('ban character', '3', '', '', 'Syntax: .ban character $Name $bantime $reason\r\nBan account and kick player.\r\n$bantime: negative value leads to permban, otherwise use a timestring like \"4d20h3s\".');
INSERT INTO `commands_text` VALUES ('levelup', '3', '', '', 'Syntax: .levelup [$playername] [#numberoflevels]\r\n\r\nIncrease/decrease the level of character with $playername (or the selected if not name provided) by #numberoflevels Or +1 if no #numberoflevels provided). If #numberoflevels is omitted, the level will be increase by 1. If #numberoflevels is 0, the same level will be restarted. If no character is selected and name not provided, increase your level. Command can be used for offline character. All stats and dependent values recalculated. At level decrease talents can be reset if need. Also at level decrease equipped items with greater level requirement can be lost.');
INSERT INTO `commands_text` VALUES ('linkgrave', '3', '', '', 'Syntax: .linkgrave #graveyard_id [alliance|horde]\r\n\r\nLink current zone to graveyard for any (or alliance/horde faction ghosts). This let character ghost from zone teleport to graveyard after die if graveyard is nearest from linked to zone and accept ghost of this faction. Add only single graveyard at another map and only if no graveyards linked (or planned linked at same map).');
INSERT INTO `commands_text` VALUES ('loadscripts', '3', '', '', 'Syntax: .loadscripts $scriptlibraryname\r\n\r\nUnload current and load the script library $scriptlibraryname or reload current if $scriptlibraryname omitted, in case you changed it while the server was running.');
INSERT INTO `commands_text` VALUES ('lookup spell', '3', '', '', 'Syntax: .lookup spell $namepart\r\n\r\nLooks up a spell by $namepart, and returns all matches with their spell ID\'s.');
INSERT INTO `commands_text` VALUES ('lookup skill', '3', '', '', 'Syntax: .lookup skill $$namepart\r\n\r\nLooks up a skill by $namepart, and returns all matches with their skill ID\'s.');
INSERT INTO `commands_text` VALUES ('lookup quest', '3', '', '', 'Syntax: .lookup quest $namepart\r\n\r\nLooks up a quest by $namepart, and returns all matches with their quest ID\'s.');
INSERT INTO `commands_text` VALUES ('lookup object', '3', '', '', 'Syntax: .lookup object $objname\r\n\r\nLooks up an gameobject by $objname, and returns all matches with their Gameobject ID\'s.');
INSERT INTO `commands_text` VALUES ('lookup itemset', '3', '', '', 'Syntax: .lookup itemset $itemname\r\n\r\nLooks up an item set by $itemname, and returns all matches with their Item set ID\'s.');
INSERT INTO `commands_text` VALUES ('lookup creature', '3', '', '', 'Syntax: .lookup creature $namepart\r\n\r\nLooks up a creature by $namepart, and returns all matches with their creature ID\'s.');
INSERT INTO `commands_text` VALUES ('maxskill', '3', '', '', 'Syntax: .maxskill\r\nSets all skills of the targeted player to their maximum values for its current level.');
INSERT INTO `commands_text` VALUES ('modify energy', '3', '', '', 'Syntax: .modify energy #energy\r\n\r\nModify the energy of the selected player. If no player is selected, modify your energy.');
INSERT INTO `commands_text` VALUES ('modify faction', '3', '', '', 'Syntax: .modify faction #factionid #flagid #npcflagid #dynamicflagid\r\n\r\nModify the faction and flags of the selected creature. Without arguments, display the faction and flags of the selected creature.');
INSERT INTO `commands_text` VALUES ('modify hp', '3', '', '', 'Syntax: .modify hp #newhp\r\n\r\nModify the hp of the selected player. If no player is selected, modify your hp.');
INSERT INTO `commands_text` VALUES ('modify mana', '3', '', '', 'Syntax: .modify mana #newmana\r\n\r\nModify the mana of the selected player. If no player is selected, modify your mana.');
INSERT INTO `commands_text` VALUES ('ban ip', '3', '', '', 'Syntax: .ban ip $Ip $bantime $reason\r\nBan IP.\r\n$bantime: negative value leads to permban, otherwise use a timestring like \"4d20h3s\".');
INSERT INTO `commands_text` VALUES ('debug getitemvalue', '3', '', '', 'Syntax: .debug getitemvalue #itemguid #field [int|hex|bit|float]\r\n\r\nGet the field #field of the item #itemguid in your inventroy.\r\n\r\nUse type arg for set output format: int (decimal number), hex (hex value), bit (bitstring), float. By default use integer output.');
INSERT INTO `commands_text` VALUES ('baninfo ip', '3', '', '', 'Syntax: .baninfo ip $ip\r\nWatch full information about a specific ban.');
INSERT INTO `commands_text` VALUES ('neargrave', '3', '', '', 'Syntax: .neargrave [alliance|horde]\r\n\r\nFind nearest graveyard linked to zone (or only nearest from accepts alliance or horde faction ghosts).');
INSERT INTO `commands_text` VALUES ('npc playemote', '3', '', '', 'Syntax: .npc playemote #emoteid\r\n\r\nMake the selected creature emote with an emote of id #emoteid.');
INSERT INTO `commands_text` VALUES ('banlist character', '3', '', '', 'Syntax: .banlist character $Name\r\nSearches the banlist for a character name pattern. Pattern required.');
INSERT INTO `commands_text` VALUES ('banlist account', '3', '', '', 'Syntax: .banlist account [$Name]\r\nSearches the banlist for a account name pattern or show full list account bans.');
INSERT INTO `commands_text` VALUES ('respawn', '3', '', '', 'Syntax: .respawn\r\n\r\nRespawn selected creature or respawn all nearest creatures (if none selected) and GO without waiting respawn time expiration.');
INSERT INTO `commands_text` VALUES ('revive', '3', '', '', 'Syntax: .revive\r\n\r\nRevive the selected player. If no player is selected, it will revive you.');
INSERT INTO `commands_text` VALUES ('showarea', '3', '', '', 'Syntax: .showarea #areaid\r\n\r\nReveal the area of #areaid to the selected character. If no character is selected, reveal this area to you.');
INSERT INTO `commands_text` VALUES ('debug moditemvalue', '3', '', '', 'Syntax: .debug modvalue #guid #field [int|float| &= | |= | &=~ ] #value\r\n\r\nModify the field #field of the item #itemguid in your inventroy by value #value. \r\n\r\nUse type arg for set mode of modification: int (normal add/subtract #value as decimal number), float (add/subtract #value as float number), &= (bit and, set to 0 all bits in value if it not set to 1 in #value as hex number), |= (bit or, set to 1 all bits in value if it set to 1 in #value as hex number), &=~ (bit and not, set to 0 all bits in value if it set to 1 in #value as hex number). By default expect integer add/subtract.');
INSERT INTO `commands_text` VALUES ('npc allowmove', '3', '', '', 'Syntax: .npc allowmove\r\n\r\nEnable or disable movement creatures in world. Not implemented.');
INSERT INTO `commands_text` VALUES ('debug getvalue', '3', '', '', 'Syntax: .debug getvalue #field [int|hex|bit|float]\r\n\r\nGet the field #field of the selected target. If no target is selected, get the content of your field.\r\n\r\nUse type arg for set output format: int (decimal number), hex (hex value), bit (bitstring), float. By default use integer output.');
INSERT INTO `commands_text` VALUES ('cast back', '3', '', '', 'Syntax: .cast back #spellid [triggered]\r\n  Selected target will cast #spellid to your character. If \'trigered\' or part provided then spell casted with triggered flag.');
INSERT INTO `commands_text` VALUES ('unaura', '3', '', '', 'Syntax: .unaura #spellid\r\n\r\nRemove aura due to spell #spellid from the selected Unit.');
INSERT INTO `commands_text` VALUES ('learn', '3', '', '', 'Syntax: .learn #spell [all]\r\n\r\nSelected character learn a spell of id #spell. If \'all\' provided then all ranks learned.');
INSERT INTO `commands_text` VALUES ('unlearn', '3', '', '', 'Syntax: .unlearn #spell [all]\r\n\r\nUnlearn for selected player a spell #spell.  If \'all\' provided then all ranks unlearned.');
INSERT INTO `commands_text` VALUES ('cast', '3', '', '', 'Syntax: .cast #spellid [triggered]\r\n  Cast #spellid to selected target. If no target selected cast to self. If \'trigered\' or part provided then spell casted with triggered flag.');
INSERT INTO `commands_text` VALUES ('wchange', '3', '', '', 'Syntax: .wchange #weathertype #status\r\n\r\nSet current weather to #weathertype with an intensity of #status.\r\n\r\n#weathertype can be 1 for rain, 6 for snow, and 3 for sand. #status can be 0 for disabled, and 1 for enabled.');
INSERT INTO `commands_text` VALUES ('gm fly', '3', '', '', 'Syntax: .gm fly [on/off]\r\nEnable/disable gm fly mode.');
INSERT INTO `commands_text` VALUES ('setskill', '3', '', '', 'Syntax: .setskill #skill #level [#max]\r\n\r\nSet a skill of id #skill with a current skill value of #level and a maximum value of #max (or equal current maximum if not provide) for the selected character. If no character is selected, you learn the skill.');
INSERT INTO `commands_text` VALUES ('auction', '3', '', '', 'Syntax: .auction\r\n\r\nShow your team auction store.');
INSERT INTO `commands_text` VALUES ('quest remove', '3', '', '', 'Syntax: .quest remove #quest_id\r\n\r\nSet quest #quest_id state to not completed and not active (and remove from active quest list) for selected player.');
INSERT INTO `commands_text` VALUES ('send message', '3', '', '', 'Syntax: .send message $playername $message\r\n\r\nSend screen message to player from ADMINISTRATOR.');
INSERT INTO `commands_text` VALUES ('send money', '3', '', '', 'Syntax: .send money #playername \"#subject\" \"#text\" #money\r\n\r\nSend mail with money to a player. Subject and mail text must be in \"\".');
INSERT INTO `commands_text` VALUES ('baninfo account', '3', '', '', 'Syntax: .baninfo account $accountid\r\nWatch full information about a specific ban.');
INSERT INTO `commands_text` VALUES ('learn all', '3', '', '', 'Syntax: .learn all\r\n\r\nLearn all big set different spell maybe useful for Administaror.');
INSERT INTO `commands_text` VALUES ('learn all_crafts', '3', '', '', 'Syntax: .learn crafts\r\n\r\nLearn all professions and recipes.');
INSERT INTO `commands_text` VALUES ('learn all_gm', '3', '', '', 'Syntax: .learn all_gm\r\n\r\nLearn all default spells for Game Masters.');
INSERT INTO `commands_text` VALUES ('learn all_lang', '3', '', '', 'Syntax: .learn all_lang\r\n\r\nLearn all languages');
INSERT INTO `commands_text` VALUES ('learn all_myclass', '3', '', '', 'Syntax: .learn all_myclass\r\n\r\nLearn all spells and talents available for his class.');
INSERT INTO `commands_text` VALUES ('reload all', '3', '', '', 'Syntax: .reload all\r\n\r\nReload all tables with reload support added and that can be _safe_ reloaded.');
INSERT INTO `commands_text` VALUES ('reload all_spell', '3', '', '', 'Syntax: .reload all\r\n\r\nReload all `spell_*` tables with reload support added and that can be _safe_ reloaded.');
INSERT INTO `commands_text` VALUES ('reload all_area', '3', '', '', 'Syntax: .reload all_area\r\n\r\nReload all `areatrigger_*` tables if reload support added for this table and this table can be _safe_ reloaded.');
INSERT INTO `commands_text` VALUES ('reload all_loot', '3', '', '', 'Syntax: .reload all_loot\r\n\r\nReload all `*_loot_template` tables. This can be slow operation with lags for server run.');
INSERT INTO `commands_text` VALUES ('reload all_quest', '3', '', '', 'Syntax: .reload all_quest\r\n\r\nReload all quest related tables if reload support added for this table and this table can be _safe_ reloaded.');
INSERT INTO `commands_text` VALUES ('learn all_myspells', '3', '', '', 'Syntax: .learn all_myspells\r\n\r\nLearn all spells (except talents and spells with first rank learned as talent) available for his class.');
INSERT INTO `commands_text` VALUES ('learn all_mytalents', '3', '', '', 'Syntax: .learn all_mytalents\r\n\r\nLearn all talents (and spells with first rank learned as talent) available for his class.');
INSERT INTO `commands_text` VALUES ('list creature', '3', '', '', 'Syntax: .list creature #creature_id [#max_count]\r\n\r\nOutput creatures with creature id #creature_id found in world. Output creature guids and coordinates sorted by distance from character. Will be output maximum #max_count creatures. If #max_count not provided use 10 as default value.');
INSERT INTO `commands_text` VALUES ('npc info', '3', '', '', 'Syntax: .npc info\r\n\r\nDisplay a list of details for the selected creature.\r\n\r\nThe list includes:\r\n- GUID, Faction, NPC flags, Entry ID, Model ID,\r\n- Level,\r\n- Health (current/maximum),\r\n\r\n- Field flags, dynamic flags, faction template, \r\n- Position information,\r\n- and the creature type, e.g. if the creature is a vendor.');
INSERT INTO `commands_text` VALUES ('movegens', '3', '', '', 'Syntax: .movegens\r\n  Show movement generators stack for selected creature or player.');
INSERT INTO `commands_text` VALUES ('server plimit', '3', '', '', 'Syntax: .server plimit [#num|-1|-2|-3|reset|player|moderator|gamemaster|administrator]\r\n\r\nWithout arg show current player amount and security level limitations for login to server, with arg set player linit ($num > 0) or securiti limitation ($num < 0 or security leme name. With `reset` sets player limit to the one in the config file');
INSERT INTO `commands_text` VALUES ('list object', '3', '', '', 'Syntax: .list object #gameobject_id [#max_count]\r\n\r\nOutput gameobjects with gameobject id #gameobject_id found in world. Output gameobject guids and coordinates sorted by distance from character. Will be output maximum #max_count gameobject. If #max_count not provided use 10 as default value.');
INSERT INTO `commands_text` VALUES ('list item', '3', '', '', 'Syntax: .list item #item_id [#max_count]\r\n\r\nOutput items with item id #item_id found in all character inventories, mails, auctions, and guild banks. Output item guids, item owner guid, owner account and owner name (guild name and guid in case guild bank). Will be output maximum #max_count items. If #max_count not provided use 10 as default value.');
INSERT INTO `commands_text` VALUES ('flusharenapoints', '3', '', '', 'Syntax: .flusharenapoints\r\n\r\nUse it to distribute arena points based on arena team ratings, and start a new week.');
INSERT INTO `commands_text` VALUES ('lookup faction', '3', '', '', 'Syntax: .lookup faction $name\r\nAttempts to find the ID of the faction with the provided $name.');
INSERT INTO `commands_text` VALUES ('reset specs', '3', '', '', 'Syntax: .reset specs [Playername]\r\n  Removes all talents (for all specs) of the targeted player or named player. Playername can be name of offline character. With player talents also will be reset talents for all character\'s pets if any.');
INSERT INTO `commands_text` VALUES ('tele add', '3', '', '', 'Syntax: .tele add $name\r\n\r\nAdd current your position to .tele command target locations list with name $name.');
INSERT INTO `commands_text` VALUES ('tele del', '3', '', '', 'Syntax: .tele del $name\r\n\r\nRemove location with name $name for .tele command locations list.');
INSERT INTO `commands_text` VALUES ('baninfo character', '3', '', '', 'Syntax: .baninfo character $charactername \r\nWatch full information about a specific ban.');
INSERT INTO `commands_text` VALUES ('damage', '3', '', '', 'Syntax: .damage $damage_amount [$school [$spellid]]\r\n\r\nApply $damage to target. If not $school and $spellid provided then this flat clean melee damage without any modifiers. If $school provided then damage modified by armor reduction (if school physical), and target absorbing modifiers and result applied as melee damage to target. If spell provided then damage modified and applied as spell damage. $spellid can be shift-link.');
INSERT INTO `commands_text` VALUES ('wp import', '3', '', '', 'Syntax: .wp import $filename');
INSERT INTO `commands_text` VALUES ('wp export', '3', '', '', 'Syntax: .wp export [#creature_guid or Select a Creature] $filename');
INSERT INTO `commands_text` VALUES ('quest complete', '3', '', '', 'Syntax: .quest complete #questid\r\nMark all quest objectives as completed for target character active quest. After this target character can go and get quest reward.');
INSERT INTO `commands_text` VALUES ('cast self', '3', '', '', 'Syntax: .cast self #spellid [triggered]\r\nCast #spellid by target at target itself. If \'trigered\' or part provided then spell casted with triggered flag.');
INSERT INTO `commands_text` VALUES ('cast target', '3', '', '', 'Syntax: .cast target #spellid [triggered]\r\n  Selected target will cast #spellid to his victim. If \'trigered\' or part provided then spell casted with triggered flag.');
INSERT INTO `commands_text` VALUES ('instance unbind', '3', '', '', 'Syntax: .instance unbind all\r\n  All of the selected\r\nplayer\'s binds will be cleared.\r\n.instance unbind #mapid\r\n Only the\r\nspecified #mapid instance will be cleared.');
INSERT INTO `commands_text` VALUES ('instance listbinds', '3', '', '', 'Syntax: .instance listbinds\r\n  Lists the binds of the selected player.');
INSERT INTO `commands_text` VALUES ('instance stats', '3', '', '', 'Syntax: .instance stats\r\n  Shows statistics about instances.');
INSERT INTO `commands_text` VALUES ('instance savedata', '3', '', '', 'Syntax: .instance savedata\r\n  Save the InstanceData for the current player\'s map to the DB.');
INSERT INTO `commands_text` VALUES ('cast dist', '3', '', '', 'Syntax: .cast dist #spellid [#dist [triggered]]\r\n  You will cast spell to pint at distance #dist. If \'trigered\' or part provided then spell casted with triggered flag. Not all spells can be casted as area spells.');
INSERT INTO `commands_text` VALUES ('server idlerestart', '3', '', '', 'Syntax: .server idlerestart #delay\r\n\r\nRestart the server after #delay seconds if no active connections are present (no players). Use #exist_code or 2 as program exist code.');
INSERT INTO `commands_text` VALUES ('server idlerestart cancel', '3', '', '', 'Syntax: .server idlerestart cancel\r\n\r\nCancel the restart/shutdown timer if any.');
INSERT INTO `commands_text` VALUES ('reload config', '3', '', '', 'Syntax: .reload config\r\n\r\nReload config settings (by default stored in mangosd.conf). Not all settings can be change at reload: some new setting values will be ignored until restart, some values will applied with delay or only to new objects/maps, some values will explicitly rejected to change at reload.');
INSERT INTO `commands_text` VALUES ('reload all_locales', '3', '', '', 'Syntax: .reload all_locales\r\n\r\nReload all `locales_*` tables with reload support added and that can be _safe_ reloaded.');
INSERT INTO `commands_text` VALUES ('reset spells', '3', '', '', 'Syntax: .reset spells [Playername]\r\n  Removes all non-original spells from spellbook.\r\n. Playername can be name of offline character.');
INSERT INTO `commands_text` VALUES ('account set addon', '3', '', '', 'Syntax: .account set addon [#accountId|$accountName] #addon\r\n\r\nSet user (possible targeted) expansion addon level allowed. Addon values: 0 - normal, 1 - tbc, 2 - wotlk.');
INSERT INTO `commands_text` VALUES ('account characters', '3', '', '', 'Syntax: .account characters [#accountId|$accountName]\r\n\r\nShow list all characters for account selected by provided #accountId or $accountName, or for selected player in game.');
INSERT INTO `commands_text` VALUES ('gm list', '3', '', '', 'Syntax: .gm list\r\n\r\nDisplay a list of all Game Masters accounts and security levels.');
INSERT INTO `commands_text` VALUES ('reset level', '3', '', '', 'Syntax: .reset level [Playername]\r\n  Reset level to 1 including reset stats and talents.  Equipped items with greater level requirement can be lost.');
INSERT INTO `commands_text` VALUES ('server restart', '3', '', '', 'Syntax: .server restart #delay\r\n\r\nRestart the server after #delay seconds. Use #exist_code or 2 as program exist code.');
INSERT INTO `commands_text` VALUES ('server set motd', '3', '', '', 'Syntax: .server set motd $MOTD\r\n\r\nSet server Message of the day.');
INSERT INTO `commands_text` VALUES ('pdump load', '3', '', '', 'Syntax: .pdump load $filename $account [$newname] [$newguid]\r\nLoad character dump from dump file into character list of $account with saved or $newname, with saved (or first free) or $newguid guid.');
INSERT INTO `commands_text` VALUES ('pdump write', '3', '', '', 'Syntax: .pdump write $filename $playerNameOrGUID\r\nWrite character dump with name/guid $playerNameOrGUID to file $filename.');
INSERT INTO `commands_text` VALUES ('ban account', '3', '', '', 'Syntax: .ban account $Name $bantime $reason\r\nBan account kick player.\r\n$bantime: negative value leads to permban, otherwise use a timestring like \"4d20h3s\".');
INSERT INTO `commands_text` VALUES ('banlist ip', '3', '', '', 'Syntax: .banlist ip [$Ip]\r\nSearches the banlist for a IP pattern or show full list of IP bans.');
INSERT INTO `commands_text` VALUES ('send items', '3', '', '', 'Syntax: .send items #playername \"#subject\" \"#text\" itemid1[:count1] itemid2[:count2] ... itemidN[:countN]\r\n\r\nSend a mail to a player. Subject and mail text must be in \"\". If for itemid not provided related count values then expected 1, if count > max items in stack then items will be send in required amount stacks. All stacks amount in mail limited to 12.');
INSERT INTO `commands_text` VALUES ('server restart cancel', '3', '', '', 'Syntax: .server restart cancel\r\n\r\nCancel the restart/shutdown timer if any.');
INSERT INTO `commands_text` VALUES ('server shutdown', '3', '', '', 'Syntax: .server shutdown #delay [#exit_code]\r\n\r\nShut the server down after #delay seconds. Use #exit_code or 0 as program exit code.');
INSERT INTO `commands_text` VALUES ('server shutdown cancel', '3', '', '', 'Syntax: .server shutdown cancel\r\n\r\nCancel the restart/shutdown timer if any.');
INSERT INTO `commands_text` VALUES ('modify phase', '3', '', '', 'Syntax: .modify phase #phasemask\r\n\r\nSelected character phasemask changed to #phasemask with related world vision update. Change active until in game phase changed, or GM-mode enable/disable, or re-login. Character pts pasemask update to same value.');
INSERT INTO `commands_text` VALUES ('reset achievements', '3', '', '', 'Syntax: .reset achievements [$playername]\r\n\r\nReset achievements data for selected or named (online or offline) character. Achievements for persistance progress data like completed quests/etc re-filled at reset. Achievements for events like kills/casts/etc will lost.');
INSERT INTO `commands_text` VALUES ('debug arena', '3', '', '', 'Syntax: .debug arena\r\n\r\nToggle debug mode for arenas. In debug mode GM can start arena with single player.');
INSERT INTO `commands_text` VALUES ('debug bg', '3', '', '', 'Syntax: .debug bg\r\n\r\nToggle debug mode for battlegrounds. In debug mode GM can start battleground with single player.');
INSERT INTO `commands_text` VALUES ('reset stats', '3', '', '', 'Syntax: .reset stats [Playername]\r\n  Resets(recalculate) all stats of the targeted player to their original VALUESat current level.');
INSERT INTO `commands_text` VALUES ('reset all', '3', '', '', 'Syntax: .reset all spells\r\n\r\nSyntax: .reset all talents\r\n\r\nRequest reset spells or talents (including talents for all character\'s pets if any) at next login each existed character.');
INSERT INTO `commands_text` VALUES ('unban account', '3', '.unban account $Name', '', 'Снять бан с учетнай записи.');
INSERT INTO `commands_text` VALUES ('unban character', '3', '.unban character $Name', '', 'Снять бан с персанажа.');
INSERT INTO `commands_text` VALUES ('unban ip', '3', '.unban ip $Ip', '', 'Снять бан с ип-адреса.');
INSERT INTO `commands_text` VALUES ('learn all_mypettalents', '3', '', '', 'Syntax: .learn all_mypettalents\r\n\r\nLearn all talents for your pet available for his creature type (only for hunter pets).');
INSERT INTO `commands_text` VALUES ('character level', '3', '', '', 'Syntax: .character level [$playername] [#level]\r\n\r\nSet the level of character with $playername (or the selected if not name provided) by #numberoflevels Or +1 if no #numberoflevels provided). If #numberoflevels is omitted, the level will be increase by 1. If #numberoflevels is 0, the same level will be restarted. If no character is selected and name not provided, increase your level. Command can be used for offline character. All stats and dependent values recalculated. At level decrease talents can be reset if need. Also at level decrease equipped items with greater level requirement can be lost.');
INSERT INTO `commands_text` VALUES ('lookup taxinode', '3', '', '', 'Syntax: .lookup taxinode $substring\r\n\r\nSearch and output all taxinodes with provide $substring in name.');
INSERT INTO `commands_text` VALUES ('reload all_achievement', '3', '', '', 'Syntax: .reload all_achievement\r\n\r\nReload all `achievement_*` tables if reload support added for this table and this table can be _safe_ reloaded.');
INSERT INTO `commands_text` VALUES ('reload all_eventai', '3', '', '', 'Syntax: .reload all_eventai\r\n\r\nReload `creature_ai_*` tables if reload support added for these tables and these tables can be _safe_ reloaded.');
INSERT INTO `commands_text` VALUES ('reload all_item', '3', '', '', 'Syntax: .reload all_item\r\n\r\nReload `item_required_target`, `page_texts` and `item_enchantment_template` tables.');
INSERT INTO `commands_text` VALUES ('reload all_npc', '3', '', '', 'Syntax: .reload all_npc\r\n\r\nReload `points_of_interest` and `npc_*` tables if reload support added for these tables and these tables can be _safe_ reloaded.');
INSERT INTO `commands_text` VALUES ('reload all_scripts', '3', '', '', 'Syntax: .reload all_scripts\r\n\r\nReload `*_scripts` tables.');
INSERT INTO `commands_text` VALUES ('list talents', '3', '', '', 'Syntax: .list talents\r\n\r\nShow list all really known (as learned spells) talent rank spells for selected player or self.');
INSERT INTO `commands_text` VALUES ('reset talents', '3', '', '', 'Syntax: .reset talents [Playername]\r\n  Removes all talents (current spec) of the targeted player or pet or named player. With player talents also will be reset talents for all character\'s pets if any.');
INSERT INTO `commands_text` VALUES ('character deleted list', '3', '', '', 'Syntax: .character deleted list [#guid|$name]\r\n\r\nShows a list with all deleted characters.\r\nIf $name is supplied, only characters with that string in their name will be selected, if #guid is supplied, only the character with that GUID will be selected.');
INSERT INTO `commands_text` VALUES ('character deleted restore', '3', '', '', 'Syntax: .character deleted restore #guid|$name [$newname] [#new account]\r\n\r\nRestores deleted characters.\r\nIf $name is supplied, only characters with that string in their name will be restored, if $guid is supplied, only the character with that GUID will be restored.\r\nIf $newname is set, the character will be restored with that name instead of the original one. If #newaccount is set, the character will be restored to specific account character list. This works only with one character!');
INSERT INTO `commands_text` VALUES ('stable', '3', '', '', 'Syntax: .stable\r\n\r\nShow your pet stable.');
INSERT INTO `commands_text` VALUES ('auction alliance', '3', '', '', 'Syntax: .auction alliance\r\n\r\nShow alliance auction store independent from your team.');
INSERT INTO `commands_text` VALUES ('auction goblin', '3', '', '', 'Syntax: .auction goblin\r\n\r\nShow goblin auction store common for all teams.');
INSERT INTO `commands_text` VALUES ('auction horde', '3', '', '', 'Syntax: .auction horde\r\n\r\nShow horde auction store independent from your team.');
INSERT INTO `commands_text` VALUES ('debug modvalue', '3', '', '', 'Syntax: .debug modvalue #field [int|float| &= | |= | &=~ ] #value\r\n\r\nModify the field #field of the selected target by value #value. If no target is selected, set the content of your field.\r\n\r\nUse type arg for set mode of modification: int (normal add/subtract #value as decimal number), float (add/subtract #value as float number), &= (bit and, set to 0 all bits in value if it not set to 1 in #value as hex number), |= (bit or, set to 1 all bits in value if it set to 1 in #value as hex number), &=~ (bit and not, set to 0 all bits in value if it set to 1 in #value as hex number). By default expect integer add/subtract.');
INSERT INTO `commands_text` VALUES ('debug setitemvalue', '3', '', '', 'Syntax: .debug setitemvalue #guid #field [int|hex|bit|float] #value\r\n\r\nSet the field #field of the item #itemguid in your inventroy to value #value.\r\n\r\nUse type arg for set input format: int (decimal number), hex (hex value), bit (bitstring), float. By default expect integer input format.');
INSERT INTO `commands_text` VALUES ('debug setvalue', '3', '', '', 'Syntax: .debug setvalue #field [int|hex|bit|float] #value\r\n\r\nSet the field #field of the selected target to value #value. If no target is selected, set the content of your field.\r\n\r\nUse type arg for set input format: int (decimal number), hex (hex value), bit (bitstring), float. By default expect integer input format.');
INSERT INTO `commands_text` VALUES ('debug spellmods', '3', '', '', 'Syntax: .debug spellmods (flat|pct) #spellMaskBitIndex #spellModOp #value\r\n\r\nSet at client side spellmod affect for spell that have bit set with index #spellMaskBitIndex in spell family mask for values dependent from spellmod #spellModOp to #value.');
INSERT INTO `commands_text` VALUES ('achievement', '3', '', '', 'Syntax: .achievement $playername #achivementid\r\n\r\nShow state achievment #achivmentid (can be shift link) and list of achievement criteria with progress data for selected player in game or by player name.');
INSERT INTO `commands_text` VALUES ('achievement add', '3', '', '', 'Syntax: .achievement add $playername #achivementid\r\n\r\nComplete achievement and all it\'s criteria for selected player in game or by player name. Command can\'t be used for counter achievements.');
INSERT INTO `commands_text` VALUES ('achievement remove', '3', '', '', 'Syntax: .achievement remove $playername #achivementid\r\n\r\nRemove complete state for achievement #achivmentid and reset all achievement\'s criteria for selected player in game or by player name. Also command can be used for reset counter achievements.');
INSERT INTO `commands_text` VALUES ('achievement criteria add', '3', '', '', 'Syntax: .achievement criteria add $playername #criteriaid #change\r\n\r\nIncrease progress for non-completed criteria at #change for selected player in game or by player name. If #chnage not provided then non-counter criteria progress set to completed state. For counter criteria increased at 1.');
INSERT INTO `commands_text` VALUES ('achievement criteria remove', '3', '', '', 'Syntax: .achievement criteria remove $playername #criteriaid #change\r\n\r\necrease progress for criteria at #change for selected player in game or by player name. If #chnage not provided then criteria progress reset to 0.');
INSERT INTO `commands_text` VALUES ('send mass items', '3', '', '', 'Syntax: .send mass items #racemask|$racename|alliance|horde|all \"#subject\" \"#text\" itemid1[:count1] itemid2[:count2] ... itemidN[:countN]\r\n\r\nSend a mail to players. Subject and mail text must be in \"\". If for itemid not provided related count values then expected 1, if count > max items in stack then items will be send in required amount stacks. All stacks amount in mail limited to 12.');
INSERT INTO `commands_text` VALUES ('send mass mail', '3', '', '', 'Syntax: .send mass mail #racemask|$racename|alliance|horde|all \"#subject\" \"#text\"\r\n\r\nSend a mail to players. Subject and mail text must be in \"\".');
INSERT INTO `commands_text` VALUES ('send mass money', '3', '', '', 'Syntax: .send mass money #racemask|$racename|alliance|horde|all \"#subject\" \"#text\" #money\r\n\r\nSend mail with money to players. Subject and mail text must be in \"\".');
INSERT INTO `commands_text` VALUES ('debug spellcoefs', '3', '', '', 'Syntax: .debug spellcoefs #spellid\r\n\r\nShow default calculated and DB stored coefficients for direct/dot heal/damage.');
INSERT INTO `commands_text` VALUES ('account friend add', '3', '', '', 'Syntax: .account friend add [#accountId|$accountName] [#friendaccountId|$friendaccountName]\r\n\r\nSet friend account.');
